import { increment, decrement, sign_in } from "./../actions/counter";
const Markets = () => {
  return (
    <div>
      <div className="result"></div>
      <button>
        <AddIcon />
      </button>
      <button>
        <RemoveIcon />
      </button>
    </div>
  );
};
export default Markets;
